// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';


function id(t) {
  return t.id;
}

function name(t) {
  return t.name;
}

function makeFromJs(jsObject) {
  return {
          id: jsObject.id,
          name: jsObject.name
        };
}

exports.id = id;
exports.name = name;
exports.makeFromJs = makeFromJs;
/* No side effect */
